import React from "react";
import ReactDOM from "react-dom";
import "./grid.css";
import NavBar from "./components/NavBar";
import "./App.css";
import Greeting from "./components/Greeting";
import PortContent from "./components/PortContent";
import PortContentList from "./components/PortContentList";
import AboutMe from "./components/AboutMe";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      navBar: ["TRANG CHỦ", "PORTFOLIO", "RESUME", "VỀ TÔI", "LIÊN HỆ"],
      linkContent: ["Mockup", "Poster", "Pics", "Ấn phẩm", "Truyền thông"],
    };
  }

  render() {
    return (
      <div className="body">
        <div className="cover">
          <NavBar content={this.state.navBar} />
          <Greeting />
        </div>

        <div className="content">
          <div className="portfolio">
            <h1> Sản phẩm từng thực hiện </h1>
            <NavBar content={this.state.linkContent} />
            <PortContentList />
          </div>

          <div className="about-me">
            <AboutMe />
          </div>
        </div>
      </div>
    );
  }
}
export default App;
